import React, { Component } from "react";
import Display from './Display';

export default class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
    };
  }


  componentDidMount() {
    this.getKitchen();
  }

  render() {
    return(
      <div>
        <Display data={this.state.items}/>
      </div>
    );
  }
}
